  true,\n\t\"url\": null,\n\t\"notes\": \"The Population Exposure Estimates in Proximity
  to Nuclear Power Plants, Country-Level Aggregates data set consists of country-level
  estimates of total, urban, and rural populations and land area, country-wide, that
  are in proximity to a nuclear power plant. This data set was created using a global
  data set of point locations of nuclear power plants, with buffer zones at 30km,
  75km, 150km, 300km, 600km, and 1200km, and the Global Population Count Grid Time
  Series Estimates, Version 1 to estimate the population within each buffer zone for
  the years 1990, 2000, and 2010. Global Rural-Urban Mapping Project, Version 1 (GRUMPv1)
  Land and Geographic Unit Area Grids were used to estimate land area within each
  buffer zone. The GRUMPv1 Urban Extents Grid was used to further delineate population
  and land area estimates within urban and rural areas. All grids used for population,
  land area, and urban mask were of 1 km (30 arc-second) resolution.\",\n\t\"license_title\":
